    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <a className="navbar-brand" href="/">
        Navbar
      </a>
      <span className="badge badge-primary">{this.props.productsCount}</span>
    </nav>
  );
};

export default NavBar;
